import React from 'react';
import Styled from './StyledComponents'; // Assuming StyledComponents is the file name where StyledButton is defined

interface ButtonProps {
    text: string;
    color?: string; // customColor prop passed to StyledButton
    variant?: 'text' | 'contained' | 'outlined';
    [x: string]: any; // Allowing for additional props
}

const Button: React.FC<ButtonProps> = ({ text, color, variant = 'contained', ...props }) => (
    <Styled.StyledButton customColor={color} variant={variant} {...props}>
      {text}
    </Styled.StyledButton>
);

export default Button;
